import React from 'react';
import HomePageContainer from './homepage.styles.jsx';

import Directory from '../../components/directory/directory.component';

const HomePage = () => (
    <HomePageContainer className='homepage'>
        <Directory />
    </HomePageContainer>
)

export default HomePage;
